import React, { useEffect, useState } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { fetchRepairs, addRepair, updateRepair, removeRepair } from '../redux/repairSlice'
import api from '../services/api'

function RepairRow({ r, onDelete, onSave }) {
  const [editing, setEditing] = useState(false)
  const [form, setForm] = useState({
    item_name: r.item_name,
    cost: r.cost,
    replaced_by: r.replaced_by || '',
    description: r.description || '',
    status: r.status,
  })

  const save = async () => {
    await onSave(r.id, form)
    setEditing(false)
  }

  if (editing) {
    return (
      <tr className="border-t">
        <td className="px-4 py-2"><input className="border p-1" value={form.item_name} onChange={e => setForm({ ...form, item_name: e.target.value })} /></td>
        <td className="px-4 py-2">{r.repair_date}</td>
        <td className="px-4 py-2"><input className="border p-1" type="number" step="0.01" value={form.cost} onChange={e => setForm({ ...form, cost: e.target.value })} /></td>
        <td className="px-4 py-2"><input className="border p-1" value={form.replaced_by} onChange={e => setForm({ ...form, replaced_by: e.target.value })} /></td>
        <td className="px-4 py-2"><input className="border p-1" value={form.description} onChange={e => setForm({ ...form, description: e.target.value })} /></td>
        <td className="px-4 py-2">
          <select className="border p-1" value={form.status} onChange={e => setForm({ ...form, status: e.target.value })}>
            <option>Pending</option>
            <option>Completed</option>
          </select>
        </td>
        <td className="px-4 py-2">
          <button onClick={save} className="mr-2 text-sm text-green-600">Save</button>
          <button onClick={() => setEditing(false)} className="text-sm text-gray-600">Cancel</button>
        </td>
      </tr>
    )
  }

  return (
    <tr className="border-t">
      <td className="px-4 py-2">{r.item_name}</td>
      <td className="px-4 py-2">{r.repair_date}</td>
      <td className="px-4 py-2">â‚¹{r.cost}</td>
      <td className="px-4 py-2">{r.replaced_by}</td>
      <td className="px-4 py-2">{r.description}</td>
      <td className="px-4 py-2"><span className={r.status === 'Completed' ? 'text-green-600' : 'text-yellow-600'}>{r.status}</span></td>
      <td className="px-4 py-2">
        <button onClick={() => setEditing(true)} className="mr-2 text-sm text-blue-600">Edit</button>
        <button onClick={() => onDelete(r.id)} className="text-sm text-red-600">Delete</button>
      </td>
    </tr>
  )
}

export default function Repairs() {
  const dispatch = useDispatch()
  const { list: repairs, status } = useSelector(state => state.repairs)
  const [form, setForm] = useState({ item_name: '', repair_date: '', cost: '', replaced_by: '', description: '', status: 'Pending' })

  useEffect(() => {
    dispatch(fetchRepairs())
  }, [dispatch])

  const create = async (e) => {
    e.preventDefault()
    try {
      const res = await api.post('/repairs/', form)
      dispatch(addRepair(res.data))
      setForm({ item_name: '', repair_date: '', cost: '', replaced_by: '', description: '', status: 'Pending' })
    } catch (err) { console.error(err) }
  }

  const remove = async (id) => {
    if (!confirm('Delete repair?')) return
    await api.delete(`/repairs/${id}/`)
    dispatch(removeRepair(id))
  }

  const save = async (id, data) => {
    const res = await api.patch(`/repairs/${id}/`, data)
    dispatch(updateRepair(res.data))
  }

  const loading = status === 'loading'

  return (
    <div>
      <h2 className="text-xl font-semibold mb-4">Repairs</h2>

      <form onSubmit={create} className="mb-6 space-y-2 max-w-lg">
        <div>
          <input className="border p-2 w-full" placeholder="Item name" value={form.item_name} onChange={e => setForm({ ...form, item_name: e.target.value })} />
        </div>
        <div>
          <input type="date" className="border p-2 w-full" value={form.repair_date} onChange={e => setForm({ ...form, repair_date: e.target.value })} />
        </div>
        <div>
          <input className="border p-2 w-full" placeholder="Cost" type="number" step="0.01" value={form.cost} onChange={e => setForm({ ...form, cost: e.target.value })} />
        </div>
        <div>
          <input className="border p-2 w-full" placeholder="Replaced by" value={form.replaced_by} onChange={e => setForm({ ...form, replaced_by: e.target.value })} />
        </div>
        <div>
          <input className="border p-2 w-full" placeholder="Description" value={form.description} onChange={e => setForm({ ...form, description: e.target.value })} />
        </div>
        <button className="bg-green-600 text-white px-3 py-1 rounded">Add Repair</button>
      </form>

      {loading ? <div>Loading...</div> : (
        <table className="min-w-full bg-white">
          <thead>
            <tr>
              <th className="px-4 py-2">Item</th>
              <th className="px-4 py-2">Date</th>
              <th className="px-4 py-2">Cost</th>
              <th className="px-4 py-2">Replaced By</th>
              <th className="px-4 py-2">Description</th>
              <th className="px-4 py-2">Status</th>
              <th className="px-4 py-2">Actions</th>
            </tr>
          </thead>
          <tbody>
            {repairs.map(r => (
              <RepairRow key={r.id} r={r} onDelete={remove} onSave={save} />
            ))}
          </tbody>
        </table>
      )}
    </div>
  )
}
